import React from "react";
import { data } from "../../data";

const QuestionBlock = () => {
  return (
    <div>
      {data.questions.map((data, key) => {
        return (
          <div key={key}>
            {data.question}
            {data.questionoption.map((question, key) => {
              return (
                <div key={key}>
                  <input type={data.questiontype} />
                  <label>{question.optionvalue}</label>
                </div>
              );
            })}
          </div>
        );
      })}
    </div>
  );
};

export default QuestionBlock;
